    const [dummy,setDummy] = useState([{
        title:'Gossip Magazine',reviews:'500',message:'fnkjnfdfknkndkmlkcnjdidf'
    },{
        title:'Top Movies',reviews:'100',message:'fnkjnfdfknkndkmlkcnjdidf'
    },{
        title:'Trending Technology',reviews:'30',message:'fnkjnfdfknkndkmlkcnjdidf'
    },
    {
        title:'JavaScript in Native',reviews:'400',message:'fnkjnfdfknkndkmlkcnjdidf'
    }
    ])
    const displayTodo = ({data})=>{
        <ListItem>
            <ListItem.Title>
                
            </ListItem.Title>
        </ListItem>
    }
    return(
        <>
        <View>
            <FlatList
            data={dummy}
            renderItem={(item)=>(
                <TouchableOpacity onPress={()=>navigation.navigate('map',item)}>
                    <Text style={{padding:'2%',fontSize:28,fontWeight:'700'}}>{}</Text>
                </TouchableOpacity>
            )}
            />
        </View>
        </>
    )
}
export default Practice
